import React, { useEffect, useState } from 'react';

function Header({history}) {
    // const check = false;
    const [check, setCheck] = useState(false);

    const goHome = () => {
        history.replace("/");
        check = true;
    };

    useEffect(() => {
        console.log(history);
        const unblock = history.block("시작 화면으로 가실건가요?");
        return () => {
            unblock();
        };
    }, [check]);

    return (
        <div>
            <div className="Header">
                <div onClick={goHome}>투자 유니버스</div>
            </div>
        </div>
    );
}

export default Header;
